import React from 'react'
import { Card } from './Card'
import './Cards.css'
import image1 from '../assets/fullst.png'

const myCards = [
   {
      id: 1,
      title: 'Full Stack',
      image: image1
   },
   {
      id: 2,
      title: 'Frontend',
      image: image2
   }
]

export const Cards = () => {
    return ( 
    <div className="container cards-style d-flex justify-content-center align-items-center
    bg-info">
       <div className="row">
         <div className="col-md-4">
         <Card/>
         </div> 
       </div>
    </div>
   ) 
}
